      | 365290 -> { ItemTypeData.id= 365290; name= "Pilot gk.0"; published= false; description= "The Pilot dropsuit enhances vehicle operability. Using an adaptive synth-nerve network, the suit seamlessly integrates with on-board systems, establishing a cognitive link between the user and the host vehicle. This provides unprecedented control over every aspect of a vehicle’s weapon, navigation, propulsion, and electronic subsystems.    Ill-suited to frontline combat, the Gallente suit instead incorporates a host of structural monitoring nodes, smart I/O channels and energy management controllers into a wearable interface that enhances the performance of the vehicle’s shield and armor subsystems.    In much the same way the capsule revolutionized space flight, the Pilot suit has vastly improved the man-machine interface for planetside vehicles."; marketGroupId= None; groupId= 351064; dogmaAttributes= [|  |]; dogmaEffects= [|  |]; capacity= 0.000000; graphicId= None; mass= 0.000000; packagedVolume= 0.010000; portionSize= 1; radius= 1.000000; volume= 0.010000 } |> Some
      | 365581 -> { ItemTypeData.id= 365581; name= "'Nodeasylum' Kaalakiota Bolt Pistol"; published= false; description= "The result of years of R&D, the bolt pistol is a high-impact handgun capable of firing kinetic projectiles with pinpoint accuracy. Building upon its copious experience with microscale rail weaponry, Kaalakiota has further refined the technology to produce what is commonly regarded as the most powerful handgun on the market.    Central to its success is a smart sensor that bleeds off a minute amount of dropsuit energy at the moment of discharge, dissipating the sharp recoil impulse through the suit’s internal membrane and greatly reducing the peak force of each shot. This seemingly minor innovation is what makes accurate fire of the weapon possible without the need for an external mounting."; marketGroupId= None; groupId= 350858; dogmaAttributes= [|  |]; dogmaEffects= [|  |]; capacity= 0.000000; graphicId= None; mass= 0.000000; packagedVolume= 0.010000; portionSize= 1; radius= 1.000000; volume= 0.010000 } |> Some
